

class Solution(object):
    def shortestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """
        if not s:
            return ""
        newS ="#"
        for i in s:
            newS+=i+"#"
        size = len(newS)
        dp = [1]*size
        mxId = 0
        mx = 0
        kP=size-1
        for i in range(1,size):
            if i<mx:
                dp[i] = min(mx-i,dp[2*mxId-i])
            while dp[i]+i < size and  i- dp[i] > -1 and newS[dp[i]+i] == newS[i-dp[i]]:dp[i]+=1
            if dp[i]+i > mx:
                mx = dp[i]+i
                mxId = i
            if mx>size-1:kP = i
        pos = 1
        for k in range(kP,-1,-1):
            if k == dp[k]-1:
                pos = k
                break
        ans = ""
        for i in range(len(s)-1,pos-1,-1):
            ans+=s[i]
        return ans+s

    def longestPal(self,s):
        newS ="#"
        for i in s:
            newS+=i+"#"
        size = len(newS)
        dp = [1 for j in range(size)]
        mxId = 0
        mx = 1
        kP=size-1
        for i in range(1,size):
            mapI = 2*mxId-i
            maxL = mx-i
            if mx > size:kP=i
            if dp[mapI] >=maxL:
                dp[i] = maxL
                while dp[i]+i < size and  i- dp[i] > -1 and newS[dp[i]+i] == newS[i-dp[i]]:dp[i]+=1
                if dp[i]+i > mx:
                    mx = dp[i]+i
                    mxId = i
            else:dp[i] = dp[mapI]
        pos = 1
        print(dp)
        for k in range(kP,-1,-1):
            if k == dp[k]-1:
                pos = k
                break
        return pos

